css:
.highlight.linter-warning .region {
  background: linear-gradient(to bottom, #fd562b 0%, rgba(253, 86, 43, 0.30000000000000004) 20%, rgba(253, 86, 43, 0.30000000000000004) 80%, #fd562b 100%);
  border-left: 2px solid #fd562b;
  border-right: 2px solid #fd562b;
}
.highlight.linter-error .region {
  background: linear-gradient(to bottom, #fb4f4f 0%, rgba(251, 79, 79, 0.30000000000000004) 20%, rgba(251, 79, 79, 0.30000000000000004) 80%, #fb4f4f 100%);
  border-left: 2px solid #fb4f4f;
  border-right: 2px solid #fb4f4f;
}
